    false,nt"url": null,nt"notes": "This part of DS 781 presents data for the
    bathymetry and shaded-relief maps of Offshore of San Francisco, California (raster
    data file is included in "BathymetryHS_OffshoreSanFrancisco.zip," which is accessible
    from http://pubs.usgs.gov/ds/781/OffshoreSanFrancisco/data_catalog_OffshoreSanFrancisco.html.
    The bathymetry and shaded-relief maps of Offshore of San Francisco, California,
    were generated from bathymetry data collected by Fugro Pelagos, and by California
    State University, Monterey Bay (CSUMB). Mapping was completed between 2004 and 2008,
    using a combination of 400-kHz Reson 7125 and 244-kHz Reson 8101 multibeam echosounders.
    These mapping missions combined to collect bathymetry (sheets 1, 2) from about the
    10-m isobath to beyond the 3-nautical-mile limit of California's State Waters. A
    large portion of this map area was re-mapped in 2009, however the older bathymetry
    data were used in this map due to co-registered, acoustic backscatter data.",nt"license_title":
